import React from 'react';
import CertificateTemplate from '../components/CertificateTemplate';

const TestCertificate = () => {
  const sampleData = {
    name: 'Rahul Kumar',
    event: 'Cloud Computing Workshop',
    type: 'First Prize Winner',
    organizer: 'Computer Science Department',
    certificateId: 'CERT-2023-001',
    date: 'December 18, 2023'
  };

  return (
    <div style={{
      padding: '40px',
      backgroundColor: '#f0f2f5',
      minHeight: '100vh',
      textAlign: 'center'
    }}>
      <h1 style={{ color: '#2c3e50', marginBottom: '30px' }}>Certificate Design Preview</h1>
      
      <CertificateTemplate certificateData={sampleData} />
      
      <div style={{ marginTop: '30px', padding: '20px', background: 'white', borderRadius: '10px' }}>
        <h3>Design Features:</h3>
        <ul style={{ textAlign: 'left', display: 'inline-block' }}>
          <li>✅ Clean, professional design</li>
          <li>✅ QR Code for verification</li>
          <li>✅ Certificate ID tracking</li>
          <li>✅ Responsive layout</li>
          <li>✅ Easy to customize</li>
        </ul>
      </div>
    </div>
  );
};

export default TestCertificate;
